import React from 'react'
import './styles.css'

const Btn = () => {
  return (
    <div class="text-box">
      <a href="https://api.whatsapp.com/send?phone=5555996817475&text=" class="btn btn-white btn-animate">
        <i className="fab fa-whatsapp fa-6x"></i>
      </a>
    </div>
  )
}                

export default Btn
